def trim_same_strings(s):
    s_copy = s
    start_str = s[0]
    end_str = s[-1]

    for i in range(1, len(s_copy), 1):
        if s[i] == start_str:
            s_copy = s_copy[1:]
        else:
            break

    for i in range(-2, -len(s_copy) - 1, -1):
        if s[i] == end_str:
            s_copy = s_copy[:-1]
        else:
            break

    return s_copy

def has_duplicate_str(st):
    cnt = 0
    for i in range(0, len(st), 1):
        cnt += st.count(st[i])

    if cnt != len(st):
        return True
    else:
        return False

